        if(fichaPaciente.padre_con_vida === 0){
            setfichaPaciente({
                ...fichaPaciente,
                padre_con_vida: 1
            })
          
        }
        else{
            setfichaPaciente({
                ...fichaPaciente,
                padre_con_vida: 0
            })
      
        }
        
    }
